import React from 'react'
import { ApiQuote } from './types/quotes.types'
interface QuoteProps{
    quote:ApiQuote
}
const Quotes = ({quote}:QuoteProps) => {
  return (

    <div>
        <h1>{quote.content}</h1>
        <p>{quote.author}</p>
        <p>{quote.dateAdded}</p>

    <div>
        {quote.tags.map((q)=>{
            return <span key={q}>{q}</span>
        })}
       </div>
    </div>

  );
}

export default Quotes
